import React from 'react'

const Header = props => {
    return(
        <div className='nav'>
            <h2>موقع</h2>
            <div className='menu'>
                <ul>
                    <li>الرئيسية</li>
                    <li>حسابي</li>
                    <li>اعدادات</li>
                </ul>
            </div>
        </div>
    );
}

export default Header
